import React from "react";
import "./dayColumn.scss";
export default function () {
  const days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  const DayBoxes = days.map((day) => <div className="day-box">{day}</div>);
  return <div className="calendar-header">{DayBoxes}</div>;
}
